/**
 *
 * TeamListView
 *
 */

import React from "react";
import PropTypes from "prop-types";
import { List as MuiList } from "@material-ui/core";

import InputAdornment from "@material-ui/core/InputAdornment";
import Typography from "@material-ui/core/Typography";
// import SearchIcon from "@material-ui/icons/Search";
// import Alert from "@material-ui/lab/Alert";

import { DocumentStatuses } from "utils/enums";
import {
  MuiCardStyled,
  CardContentStyled,
  OutlinedInputStyled,
  CardHeaderStyled,
  ListItemStyled,
  TextDiv,
  VersionDiv,
  StatusDiv,
  StatusGreenDiv,
  PaddedDiv,
} from "./styled";

const TeamListView = ({ list, search = false }) => (
  <MuiCardStyled variant="outlined">
    {
      <CardHeaderStyled
        title={<Typography variant="h6"></Typography>}
        action={<SearchAction search={search} />}
      />
    }
    <CardContentStyled>
      <List list={list} />
    </CardContentStyled>
  </MuiCardStyled>
);

TeamListView.propTypes = {
  search: PropTypes.bool,
  list: PropTypes.arrayOf(
    PropTypes.shape({
      text: PropTypes.string.isRequired,
      version: PropTypes.string,
      status: PropTypes.string,
    })
  ).isRequired,
};

const List = ({ list }) => {
  if (list.length > 0) {
    return (
      <MuiList dense={false}>
        {list.map((item, index) => (
          <ListItemStyled key={index}>
            <TextDiv>
              <Typography variant="body2">{item.text}</Typography>
            </TextDiv>
            <VersionDiv>
              <Typography variant="body2">{item.version}</Typography>
            </VersionDiv>
            <StatusDiv>
              {item.status === DocumentStatuses.PUBLISHED ? (
                <StatusGreenDiv>
                  <Typography variant="body2">{item.status}</Typography>
                </StatusGreenDiv>
              ) : (
                <StatusDiv>
                  <Typography variant="body2">{item.status}</Typography>
                </StatusDiv>
              )}
            </StatusDiv>
          </ListItemStyled>
        ))}
      </MuiList>
    );
  }
  return (
    <PaddedDiv>
      <Alert severity="info">No items to display!</Alert>
    </PaddedDiv>
  );
};

List.propTypes = {
  list: PropTypes.array,
};

const SearchAction = ({ search, handleInputChange }) =>
  search && (
    <div>
      <OutlinedInputStyled
        placeholder="Search..."
        onChange={handleInputChange}
        startAdornment={
          <InputAdornment position="start">
            {/* <SearchIcon color="disabled" fontSize="small" /> */}
          </InputAdornment>
        }
      />
    </div>
  );

SearchAction.propTypes = {
  search: PropTypes.bool,
  handleInputChange: PropTypes.func,
};

export default TeamListView;

